(78,	1,	16,	'BOMBARDIER Global 6000',	'The Bombardier Global 6000 seamlessly blends exceptional travel comfort with long-range capability. This 2019 jet boasts a spacious cabin that can seat up to 13 passengers comfortably, with sleeping berths for up to 6 individuals. Its comfortable and well-equipped cabin provides the perfect environment for relaxation or getting down to business.',	NULL,	NULL,	'2024-04-08 10:47:57',	'2024-04-08 11:10:13',	0,	NULL),
